import React from "react";
import Avatar from "./Avatar";

function Card(props) {
  return (
    <div className="card">
      <Avatar img={props.img} />
      <h2 className="name">{props.name}</h2>
      <p className="description">{props.description}</p>
      <div className="card-footer">
        <button>View Details</button>
      </div>
    </div>
  );
}

export default Card;
